                            <SplitButton
                                key={language}
                                id={`dropdown-split-variants-${language}`}
                                variant={'success'}
                                title={language || 'Select language'}
                            >
                                {Lang.map((language, index) => (
                                        <Dropdown.Item
                                            key={`${index}${language}`}
                                            eventKey={language}
                                            onClick={() => setLanguage(language)}>
                                            {language}
                                        </Dropdown.Item>
                                    )
                                )}
                            </SplitButton>
                        </Col>
                        <Col>
                            <ReactMarkdown>{answer}</ReactMarkdown>
                        </Col>
                    </Row>

                </div>
            )}
   /* ... */ }
